a.x:
var $bm_rt;
var s;
s = content('Joint').content('Joint Path').size;
$bm_rt = [
    -s[0] / 2,
    0,
    0
];

s.x:
var $bm_rt;
var strokeW, L1, L2, p1, p2, dist;
strokeW = 1;
L1 = thisComp.layer('Shape Layer 4');
L2 = thisComp.layer('Shape Layer 5');
p1 = L1.toWorld(L1.anchorPoint);
p2 = L2.toWorld(L2.anchorPoint);
dist = length(sub(p2, p1));
$bm_rt = [
    dist,
    strokeW
];

var $bm_rt;
var L, l;
L = content('Joint').content('Joint Path').size[0];
l = content('Joint').content('Joint Path').size[1];
$bm_rt = sum(0.000001, mul(100, div(l, mul(2, sum(L, l)))));

